         <label for="vehicle1"> Facebook</label><br/>
         <input type="checkbox" id="reseau2" name="reseau2" value="Instagrame"/>
         <label for="vehicle2"> Instagrame</label><br/>
         <input type="checkbox" id="reseau3" name="reseau3" value="Youtube"/>
         <label for="vehicle3"> Youtube</label><br/><br/>
         <input type="submit" value="Submit"/>
      </div>
    );
  }
}
export default Items ;
